import React from 'react';
import Pokemon from './Pokemon';

class Pokedex extends React.Component{
  render(){
    const { pokemons } = this.props;
    return(
      <div>
        {pokemons.map((poke) => <Pokemon key={poke.id} pokemon={poke}/>)}
      </div>
    );
  }


}
